webpackJsonp([0xf76797273c7f],{507:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/55-gitlab-salary/index.md absPath of file >>> MarkdownRemark",html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/648023975&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в GitLab все внутренние процессы максимально открыты и описаны в публичном Handbook, включая вилки зарплат, принцип их построения и даже интерактивный калькулятор. Воспользуемся этим калькулятором, чтобы примерить зарплату фронтенд-разработчика в GitLab на себя.</p>\n<ul>\n<li><a href="https://about.gitlab.com/handbook/">https://about.gitlab.com/handbook/</a></li>\n<li><a href="https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/">https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/</a> - зарплатный калькулятор в GitLab</li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-94">https://soundcloud.com/frontend-weekend/fw-94</a> - Денис Мишунов в подкасте Frontend Weekend.</li>\n<li><a href="https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g">https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g</a> - JavaScript.Ninja от Ильи Климова</li>\n</ul>',frontmatter:{title:"Зарплаты в GitLab",date:"July 08, 2019",featuredImage:null}}},pathContext:{slug:"/55-gitlab-salary/",previous:{fields:{slug:"/54-youtube-screencasts/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/641013810&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал.</p>\n<p>Но только этом году я попробовал записывать полноценные скринкасты: видео где показывается реализация какого-то алгоритма на JavaScript. Выбрал не самые простые темы, но интересные (по крайней мере мне). </p>\n<p>Что самое главное, постарался рассказать подробно и понятно, разбивая задачу на отдельные шаги, комментируя принимаемые решения, отвечая на собственные вопросы по ходу. Мне кажется, получилось не плохо, буду продолжать ещё.</p>\n<p>Подписывайтесь: <a href="https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw">https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw</a></p>',excerpt:"Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал. Но только этом году я попробовал записывать…",frontmatter:{title:"Скринасты Пятиминутки React на YouTube",date:"June 23, 2019",featuredImage:null}},next:null}}}});
